import React from 'react';
import { Route } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import c from './App.module.css';
import AllPosts from './components/content/allPosts/AllPosts';
import Dialogs from './components/content/dialogs/Dialogs';
import Friends from './components/content/friends/Friends';
import Profile from './components/content/profile/Profile.jsx';
import Saved from './components/content/saved/Saved';
import Settings from './components/content/settings/Settings';
import Footer from './components/footer/Footer.jsx';
import Header from './components/header/Header.jsx';
import Navbar from './components/navbar/Navbar.jsx';

const App = (props) => {
  return (
    <BrowserRouter>    
      <div className={c.App}>
        <Header />
        <div className={c.Page}>
          <Navbar />
            <Route path="/profile" render={() => <Profile myPostsData={props.myPostsData}/>}/>
            <Route path="/dialogs" render={() => <Dialogs dialogsData={props.dialogsData} messagesData={props.messagesData}/>}/>
            <Route path="/allposts" render={() => <AllPosts />}/>
            <Route path="/saved" render={() => <Saved />}/>
            <Route path="/friends" render={() => <Friends />}/>
            <Route path="/settings" render={() => <Settings />}/>
        </div>
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
